import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Card";
import Sdata from "./Sdata";
import ('./index.css');



function ncard(val) {
    return (
        <Card 
        key={val.id}
        imgsrc={val.imgscr}
        title={val.title}
        sname={val.sname}
        link={val.link}/>
    )
}

ReactDOM.render( 
    <>

    <h1 className="heading_style">List of top Netflix series in 2020</h1>
    
    
    {Sdata.map(ncard)};
    </>,
    document.getElementById('root')
    );
